CREATE TABLE `batting_details` (
  `player_id` int(10) UNSIGNED NOT NULL,
  `innings` int(11) NOT NULL,
  `batting_average` double NOT NULL,
  `balls_faced` int(11) NOT NULL,
  `runs` int(11) NOT NULL,
  `highest` int(11) NOT NULL,
  `hundreds` int(11) NOT NULL,
  `strike_rate` double NOT NULL,
  `sixes` int(11) NOT NULL,
  `fours` int(11) NOT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




